SET TERM ^;
UPDATE EMP_PRODUTO E
SET 
    E.PRD_CEST_ID = COALESCE(
        (SELECT FIRST 1 C.CEST_ID
         FROM EMP_CEST C
         WHERE C.CEST_NCM = E.PRD_NCM),
        (SELECT FIRST 1 C.CEST_ID
         FROM EMP_CEST C
         WHERE E.PRD_NCM LIKE C.CEST_NCM || '%')
    ),
    E.PRD_CEST_COD = COALESCE(
        (SELECT FIRST 1 C.CEST_COD
         FROM EMP_CEST C
         WHERE C.CEST_NCM = E.PRD_NCM),
        (SELECT FIRST 1 C.CEST_COD
         FROM EMP_CEST C
         WHERE E.PRD_NCM LIKE C.CEST_NCM || '%')
    ),
    E.PRD_CEST_NCM = COALESCE(
        (SELECT FIRST 1 C.CEST_NCM
         FROM EMP_CEST C
         WHERE C.CEST_NCM = E.PRD_NCM),
        (SELECT FIRST 1 C.CEST_NCM
         FROM EMP_CEST C
         WHERE E.PRD_NCM LIKE C.CEST_NCM || '%')
    )
WHERE EXISTS (
        SELECT 1
        FROM EMP_CEST C
        WHERE C.CEST_NCM = E.PRD_NCM
           OR E.PRD_NCM LIKE C.CEST_NCM || '%'
    );

^
SET TERM; ^

COMMIT WORK;



