------------------ INICIO DO SCRIPT QUE COLOCA OS ITENS SEM TTRIBUTAÇÃO FEDERAL PADRÃO --------------------------
SET TERM ^ ;
UPDATE EMP_PRODUTO P
SET P.PRD_PIS_SIT = (SELECT F.TRIB_PIS_SIT_SAIDA
                   FROM EMP_TRIBUTACAO_FEDERAL F
                   WHERE F.TRIB_ID = 1),

  P.PRD_PIS_ALIQUOTA = (SELECT F.TRIB_PIS_ALIQUOTA_SAIDA
                        FROM EMP_TRIBUTACAO_FEDERAL F
                        WHERE F.TRIB_ID = 1),

  P.PRD_COFINS_SIT = (SELECT F.TRIB_COFINS_SIT_SAIDA
                      FROM EMP_TRIBUTACAO_FEDERAL F
                      WHERE F.TRIB_ID = 1),

  P.PRD_COFINS_ALIQUOTA = (SELECT F.TRIB_COFINS_ALIQUOTA_SAIDA
                           FROM EMP_TRIBUTACAO_FEDERAL F
                           WHERE F.TRIB_ID = 1),

  P.PRD_PIS_SIT_ENT = (SELECT F.TRIB_PIS_SIT_ENT
                       FROM EMP_TRIBUTACAO_FEDERAL F
                       WHERE F.TRIB_ID = 1),

  P.PRD_PIS_ALIQUOTA_ENT = (SELECT F.TRIB_PIS_ALIQUOTA_ENT
                            FROM EMP_TRIBUTACAO_FEDERAL F
                            WHERE F.TRIB_ID = 1),

  P.PRD_COFINS_SIT_ENT = (SELECT F.TRIB_COFINS_SIT_ENT
                          FROM EMP_TRIBUTACAO_FEDERAL F
                          WHERE F.TRIB_ID = 1),

  P.PRD_COFINS_ALIQUOTA_ENT  = (SELECT F.TRIB_COFINS_ALIQUOTA_ENT
                                FROM EMP_TRIBUTACAO_FEDERAL F
                                WHERE F.TRIB_ID = 1),
  P.PRD_FKTRIB_FEDERAL_ID = (SELECT F.TRIB_ID
                                FROM EMP_TRIBUTACAO_FEDERAL F
                                WHERE F.TRIB_ID = 1)
WHERE P.PRD_ID = P.PRD_ID
AND P.PRD_PIS_SIT IS NULL;

^
SET TERM; ^

COMMIT WORK;

