------------------ INICIO DO SCRIPT QUE COLOCA A UNIDADE DE MEDIDA IGUAL A DA COMPRA --------------------------
SET TERM ^ ;
UPDATE EMP_PRODUTO P
SET P.PRD_FKUNDBASE_ID = 
  (SELECT FIRST 1 E.UND_ID
   FROM EMP_PRODUTO_UNDMEDIDA E
   WHERE E.UND_APELIDO = 
         (SELECT FIRST 1 I.NFEI_LKUND_FISICA_SIGLA
          FROM EMP_ENTRADAI I
          WHERE I.NFEI_FKPRD_ID = P.PRD_ID 
          ORDER BY I.NFEI_DTCAD DESC)
   ORDER BY E.UND_ID DESC)
WHERE P.PRD_ID = P.PRD_ID
AND EXISTS (
  SELECT 1 FROM EMP_PRODUTO_UNDMEDIDA E
  WHERE E.UND_APELIDO = 
        (SELECT FIRST 1 I.NFEI_LKUND_FISICA_SIGLA
         FROM EMP_ENTRADAI I
         WHERE I.NFEI_FKPRD_ID = P.PRD_ID 
         ORDER BY I.NFEI_DTCAD DESC)
);


^
SET TERM; ^

COMMIT WORK;
