          ENT_END.ENTE_COMPL, 
          ENT_END.ENTE_BAI, 
          ENT_END.ENTE_FKCID_ID,
          CID.CID_NOME,
          CID.CID_FKUF_ID,
          UF.UF_NOME,
          UF.UF_APELIDO,
          UF.UF_FKPAIS_ID,
          PAIS.PAIS_NOME,
          PAIS.PAIS_APELIDO,
          ENT_END.ENTE_CEP,
          SUBSTRING(ENT_END.ENTE_CEP FROM 1 FOR 2) || '.' || SUBSTRING(ENT_END.ENTE_CEP FROM 3 FOR 3) || '-' || SUBSTRING(ENT_END.ENTE_CEP FROM 6 FOR 3) ENTE_CEPFORMATADO,
          ENT_END.ENTE_REF,
          ENT_END.ENTE_TEL1DDD, 
          ENT_END.ENTE_TEL1, 
          ENT_END.ENTE_TEL2DDD, 
          ENT_END.ENTE_TEL2, 
          ENT_END.ENTE_TEL3DDD, 
          ENT_END.ENTE_TEL3, 
          ENT_END.ENTE_TEL4DDD, 
          ENT_END.ENTE_TEL4,
          (COALESCE(ENT_END.ENTE_END,'') || ', ' || COALESCE(ENT_END.ENTE_NO,'') || ', ' || COALESCE(ENT_END.ENTE_BAI,'') || ', ' || COALESCE(CID.CID_NOME,'')  || ' (' || COALESCE(UF.UF_APELIDO,'') || ') - CEP: ' || COALESCE(SUBSTRING(ENT_END.ENTE_CEP FROM 1 FOR 2) || '.' || SUBSTRING(ENT_END.ENTE_CEP FROM 3 FOR 3) || '-' || SUBSTRING(ENT_END.ENTE_CEP FROM 6 FOR 3),''))
   FROM ENT_END
   INNER JOIN CID ON (CID.CID_ID = ENT_END.ENTE_FKCID_ID)
   INNER JOIN UF ON (UF.UF_ID = CID.CID_FKUF_ID)
   INNER JOIN PAIS ON (PAIS.PAIS_ID = UF.UF_FKPAIS_ID)
   WHERE ENT_END.ENTE_TIPO = 1
;

